CREATE FUNCTION public.get_collectors_yearly_collections() RETURNS TABLE(mois text, ids_charges_compte bigint[], charges_compte text[], montants_collectes numeric[])
    LANGUAGE plpgsql
    AS $$
BEGIN
RETURN QUERY
select
    mois.mois,
    ARRAY_AGG (charges_compte.id) as ids_charges_compte,
    ARRAY_AGG (
        CONCAT (charges_compte.nom, ' ', charges_compte.prenoms)
    ) as charges_compte,
    ARRAY_AGG (COALESCE(collections_data.montant_collecte, 0)) AS montants_collectes
