    cross join charges_compte
    left join (
        select
            current_year_collections.numero_mois,
            mois.mois,
            current_year_collections.id_charge_compte,
            coalesce(current_year_collections.montant_collecte, 0) as montant_collecte
        from
            mois
            left join (
                select
                    id_charge_compte,
                    extract(
                        MONTH
                        from
                            date_collecte
                    ) as numero_mois,
                    SUM(montant) as montant_collecte
                from
                    collectes
                where
                    extract(
                        YEAR
                        from
                            date_collecte
                    ) = extract(
                        YEAR
                        from
                            CURRENT_DATE
                    )
                group by
                    extract(
                        MONTH
                        from
                            date_collecte
                    ),
                    id_charge_compte
                order by
                    extract(
                        MONTH
                        from
                            date_collecte
